import React, { useState } from "react";

const PlayersForm = () => {
  const [players, setPlayers] = useState({ player_1: "X", player_2: "O" });

  const getPlayers = (e) => {
    e.preventDefault();
    const player1 = e.target.player1.value;
    setPlayers(...{ player_1: player1 });
    console.log(players);
  };

  return (
    <>
      <form className="player-form" onSubmit={(e) => getPlayers(e)}>
        <label>
          Player 1 name :
          <input name="player1" type="text" />
        </label>
        <label>
          Player 2 name :
          <input name="player2" type="text" />
        </label>
        <button type="submit">Let's play!</button>
      </form>
    </>
  );
};

export default PlayersForm;
